def all_prefixes(string: str) -> List[str]:
    """ Return list of all prefixes from shortest to longest of the input string
    >>> all_prefixes('abc')
    ['a', 'ab', 'abc']
    """
    prefixes = [''] * len(string)
    for i, char in enumerate(string):
        prefixes[i] = char
        if char =='':
            prefixes[i] = ''
        if char == '(':
            prefixes[i] = '('
        if char == ')':
            prefixes[i] = ')'
        if char == '{':
            prefixes[i] = '{'
        if char == '}':
            prefixes[i] = '}'
    return prefixes

