def all_prefixes(string: str) -> List[str]:
    """ Return list of all prefixes from shortest to longest of the input string
    >>> all_prefixes('abc')
    ['a', 'ab', 'abc']
    """
    return [
        s.strip('abcdefghijklmnopqrstuvwxyz')
        for s in string.split('')
        if s.isalpha() and s.startswith('abc')
    ]

